import { useState } from "react";

const Home = () => {
  // let name = "mario";
  const [name, setName] = useState("mario");
  const [age, setAge] = useState(25);

  const handleclick = () => {
    setName("luigi");
    setName(30);
  };

  return (
    <div className="home">
      <h1> Homepage</h1>
      <p>
        {name}is {age}years old
      </p>
      <button onClick={handleclick}> click me</button>
    </div>
  );
};

export default Home;
